theme_mods.custom_css_string:
/* body-typography 
=========================*/
body{ font-family:'Roboto'; font-size:16px; font-weight:400; } 
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:80px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { height:80px; }
/* sticky-header-color 
=========================*/
.site-header-section.aux-sticky, .aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { background-color:#FFFFFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* portfolio-title-bar-overlay-pattern-opacity 
=========================*/
.single-portfolio .aux-overlay-bg-hash::before { opacity:0.5; }
/* portfolio-classic-entry-box-background-color 
=========================*/
.post-type-archive-portfolio .aux-entry-boxed .entry-main { background-color: #FFFFFF; }
/* portfolio-classic-entry-box-border-color 
=========================*/
.post-type-archive-portfolio .aux-entry-boxed .entry-main { border-color: #EAEAEA !important; }
/* portfolio-land-side-background-color 
=========================*/
.post-type-archive-portfolio .aux-item-land .aux-land-side { background-color: #FFFFFF; }
/* portfolio-land-side-border-color 
=========================*/
.post-type-archive-portfolio .aux-item-land .aux-land-side { border-color: #EAEAEA !important; }
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Lato'; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Lato'; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Lato'; } 
/* general-heading-h4 
=========================*/
body h4, body .aux-h4{ font-family:'Lato'; } 
/* single-post-title-typography 
=========================*/
.single-post .aux-primary .hentry .entry-title{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:50px; font-weight:800; text-transform:capitalize; letter-spacing:-1.2px; line-height:1.2em; } 
@media(max-width: 1024px){ .single-post .aux-primary .hentry .entry-title{ font-size:40px; }  } 
/* single-post-info-typography 
=========================*/
.single-post .hentry .entry-info{ font-family:'Lato'; color:rgb(141, 141, 141); font-size:14px; text-transform:capitalize; line-height:1.2em; } 
/* single-post-content-typography 
=========================*/
.single-post .hentry .entry-content{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:20px; line-height:2em; } 
@media(max-width: 1024px){ .single-post .hentry .entry-content{ font-size:16px; line-height:1.8em; }  } 
/* single-post-info-terms-typography 
=========================*/
.single-post .hentry .entry-info a{ color:rgb(0, 0, 0); font-weight:800; } 
.single-post .hentry .entry-info a:hover{ color:rgb(12, 86, 205); } 
/* single-post-meta-typography 
=========================*/
.single-post .hentry footer.entry-meta .entry-tax{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:20px; text-transform:uppercase; font-style:normal; line-height:1.2em; } 
/* single-post-meta-terms-typography 
=========================*/
.single-post .hentry footer.entry-meta .entry-tax a, .single-post .hentry footer.entry-meta .entry-tax i{ color:rgb(0, 0, 0); font-size:16px; font-weight:300; text-transform:capitalize; text-decoration:none; } 
.single-post .hentry footer.entry-meta .entry-tax a, .single-post .hentry footer.entry-meta .entry-tax i:hover{ color:rgb(0, 0, 0); } 
/* comment-forms-label-typo 
=========================*/
#commentform label{ color:rgb(250, 15, 15); } 
/* comment-forms-replay-title-typo 
=========================*/
#reply-title > span{ color:rgb(0, 0, 0); font-size:40px; font-weight:800; line-height:1.2em; letter-spacing:-2.48px; } 
/* comment-forms-notes-typo 
=========================*/
#commentform .comment-notes{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:16px; font-weight:300; line-height:1.2em; } 
/* comment-forms-response-title-typo 
=========================*/
.comments-title, .comment-reply-title{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:40px; font-weight:900; line-height:1.2em; letter-spacing:-2.48px; } 
/* comment-forms-button-typo 
=========================*/
#commentform .form-submit input[type="submit"]{ font-family:'Roboto'; color:rgb(255, 255, 255); font-size:14px; font-weight:400; text-transform:capitalize; line-height:1.2em; } 
/* comment-author-typo 
=========================*/
.aux-commentlist .comment-author .fn, .aux-commentlist .comment-author .fn a{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:25px; font-weight:bold; line-height:1.2em; } 
/* comment-info-typo 
=========================*/
.aux-commentlist .comment .comment-author time a{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:12px; font-weight:300; text-transform:uppercase; line-height:1.2em; } 
/* comment-content-typo 
=========================*/
.aux-commentlist .comment .comment-body{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:16px; font-weight:300; line-height:2em; } 
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #000000;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #ffffff;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #054fc4;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: #3482ff;}
/* site-featured-color-5 
=========================*/
:root{--auxin-featured-color-5: #ff7f31;}
/* site-featured-color-6 
=========================*/
:root{--auxin-featured-color-6: #ffd25f;}
/* site-featured-color-7 
=========================*/
:root{--auxin-featured-color-7: #149654;}
/* site-featured-color-8 
=========================*/
:root{--auxin-featured-color-8: #5cdb8e;}
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-family:'Lato'; } 
/* blog-post-like-icon-size 
=========================*/
.single-post .wp_ulike_general_class button::before { font-size:29px; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:28px; }
/* portfolio-single-share-button-icon-size 
=========================*/
.single-portfolio .aux-single-portfolio-share span::before { font-size:10px; }
/* portfolio-single-like-icon-size 
=========================*/
.single-portfolio .wp_ulike_general_class button::before { font-size:10px; }
/* blog-post-like-margin 
=========================*/
.single-post .wp_ulike_general_class button{ margin: 0px 40px 0px 0px } 
/* single-portfolio-content-typography 
=========================*/
.aux-single .type-portfolio .entry-content{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:16px; font-weight:300; line-height:2em; } 
/* single-portfolio-overview-title-typography 
=========================*/
.aux-single .type-portfolio .entry-side-title > h1{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:40px; font-weight:800; line-height:2.5em; letter-spacing:-2.6px; } 
/* single-portfolio-meta-typography 
=========================*/
.aux-single .type-portfolio .entry-meta-data dt{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:25px; font-weight:700; line-height:1.2em; } 
/* single-portfolio-meta-terms-typography 
=========================*/
.aux-single .type-portfolio .entry-meta-data dd, .aux-single .type-portfolio .entry-meta-data .entry-tax > a{ font-family:'Lato'; color:rgb(61, 61, 61); font-size:16px; font-weight:300; line-height:2em; } 
/* portfolio-related-posts-title-typography 
=========================*/
.single-portfolio .aux-widget-related-posts .hentry .entry-title a{ font-family:'Roboto'; color:rgb(0, 0, 0); font-size:25px; font-weight:800; font-style:normal; line-height:1.2em; } 
/* portfolio-related-posts-label-typography 
=========================*/
.single-portfolio .aux-widget-related-posts .widget-title{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:45px; font-weight:900; text-transform:capitalize; line-height:2em; letter-spacing:-2.25px; } 
/* single-portfolio-overview-content-typography 
=========================*/
.aux-single .type-portfolio .entry-side-overview{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:16px; font-weight:300; line-height:2em; } 
/* portfolio-related-posts-terms-typography 
=========================*/
.single-portfolio .aux-widget-related-posts .hentry .entry-tax a{ font-family:'Roboto'; color:rgb(180, 180, 180); font-size:16px; font-weight:400; font-style:normal; line-height:1.5em; } 
/* comment-forms-placeholder-typo 
=========================*/
#commentform input::placeholder, #commentform textarea::placeholder{ font-family:'Lato'; color:rgb(0, 0, 0); font-size:16px; font-weight:400; font-style:normal; line-height:1.2em; }

